import { STORY_ADD, STORY_FETCH } from "../constants/actionTypes";

const doAddStories = stories => ({
    type: STORY_ADD,
    stories
});

const doFetchStories = query => ({
    type: STORY_FETCH,
    query
});

export {
    doAddStories,
    doFetchStories
}
